import React from "react";


export default function Registration(args){
    const [login,     changeLogin    ] = React.useState('')
    const [password,  changePassword ] = React.useState('')
    const [password2, changePassword2] = React.useState('')
    function submitUser(){
        console.log();
    }
    function editLogin(value){
        console.log(value);
        changeLogin(value)
    }
    function editPassword(value){
        console.log(value);
        changePassword(value)
    }
    function editPassword2(value){
        console.log(value);
        changePassword2(value)
    }

    return(
        <>
        {args.users.length ? <p> {args.users} </p> : <p> no users</p>}
        {/* {args.createUsers('userssssssss')} */}
        <form onSubmit={submitUser} className="registrationDiv">
            <p>Registration</p>
            <span>Create account</span>
            <div className="forms">
                <input onChange={() => editLogin()} value ={login}     id="login"     type="text"      placeholder="Login" />
                <input onChange={() => editPassword()} value ={password}  id="password"  type="password"  placeholder="Password" />
                <input onChange={() => editPassword2()} value ={password2} id="password2" type="password"  placeholder="Reset password" />
            </div> 
            <p id="errortext">Error</p>
            <button type="submit" id="but" onClick={event => console.log( event.target.id)}>Create</button>
        </form>  
        </>
    )
}
